import React, {useState, useRef, useEffect} from 'react'
import Feed from './Feed'
import axios from 'axios'


const InstaFeed =({token, ...props}) => {
    const [feed, setFeed] = useState([]);
    const tokenProp = useRef(token);
    tokenProp.current = token;


    useEffect(()=>{
        fetch(`https://api.instagram.com/oauth/authorize
        ?client_id=${process.env.REACT_APP_INS_APP_ID}
        &redirect_uri=${process.env.REACT_APP_INS_REDIRECT_URI}
        &scope=user_profile,user_media
        &response_type=code`).then((response)=>{
          console.log(response.json());

          const parsedURL = url.parse(response.config.url);
          console.log(parsedURL.host);

        })
    }, [props.limit])
  return (
    <div>
        {feed.map((f)=>{
            <Feed key={f.id} igfeed={f}/>
        })}
    </div>
  )
}

export default InstaFeed;
